import React from "react";

import TodoItem from "./TodoItem";

export default class TodoList extends React.Component {
  render() {
    const todos = this.props.todos.map((todo, i) => {
      return (
        <TodoItem
          key={i}
          title={todo.title}
          desc={todo.desc}
          isDone={todo.isDone}
          handleClick={this.props.handleClick}
        ></TodoItem>
      );
    });
    return <ul>{todos}</ul>;
  }
}
